import React, { useState } from "react";
import {Link} from 'react-router-dom';
import {selectIsLoggedIn} from "../../../slice/authSlice";

import SignUp from './Signup';

import "../../../styles/main/LandingPage.css";

const LandingPage = () => {

    return (
        <div className="landing_wrapper">
            <div id="navbar">
                <div id="logo_wrapper">
                </div>
                <div id="right_navbar">
                    <a class="navbar_link">Ihre Vorteile</a>
                    <a class="navbar_link">Unser Team</a>
                    <a class="navbar_link">Kontakt</a>
                    <Link to={"/login"} id="login" class="navbar_link active_link">Log in</Link>
                </div>
            </div>

            <div id="main">
                <div className="main_section">
                    <p id="main_txt">Spielerisch ihren Umsatz steigern</p>
                    <p id="main_sub_text">Durch die Zusammenarbeit von angehenden Ärzten und Krankenhäusern wirklich alle ICD Codes erfassen und so das Geld erhalten, welches Ihrem Krankenhaus zusteht.</p>
                </div>
                <SignUp />
            </div>

            <div id="solution">
                   here comes customer slider
                   trusted by more than x hospitals
                   used by more than x users
                   Customer logos here
             </div>

        </div>

    );
};

export default LandingPage;
